import React from 'react'
import { NavLink } from 'react-router-dom'
import * as ROUTES from '../../constants/routes'
import styled from 'styled-components'

import Button from '../../style/FormUI/Buttons.js'
import profile from '../../images/Alexandra.jpg'


const Heading = styled.div`
    width: 100%;
    height: 10rem;
    background-color: var(--color-main)
`
const Wrapper = styled.div`
    width: 60%;

`
const StyledImage = styled.img`
    position: relative;
    border-radius: 50%; 
    align-items: center;
    display: block;
    top: -5rem;
    width: 15rem;
    height: 15rem;
    object-fit: cover;
`
const InnerWrapper = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`

const Profile = () => {
    return (
        <>
            <Heading/>
            <Wrapper>
                <StyledImage src = {profile} alt = "Profile" />
                <InnerWrapper>
                    <div> Code goes here </div>
                    <NavLink to = {ROUTES.PROFILE_EDIT}><Button contain> Edit Profile </Button></NavLink>
                </InnerWrapper>
            </Wrapper>
        </>
    )
}

const mapStateToProps = ({ firebase }) => ({
    profile: firebase.profile,
})

const mapDispatchToProps = {
    updateImageUrl: actions.updateImageUrl,
}

export default connect(mapStateToProps, mapDispatchToProps)(Profile);
